import React from 'react';

type Props = {
    //TODO CREATE MODEL AGENDA EXP
    id: number;
    fechaInicioEvento: Date;
    fechaFinEvento: Date;
    diaCompleto: boolean;
    descripcion: String;
    expedienteId: number;
    documentoExpId: number;
    tipoEventoAgenda: String;
    actuacionExpList: Array<number>;
    expedienteFusionId: number;
}

const Agenda: React.FC<Props> = ({
    id,
    fechaInicioEvento,
    fechaFinEvento,
    diaCompleto,
    descripcion,
    expedienteId,
    documentoExpId,
    tipoEventoAgenda,
    actuacionExpList,
    expedienteFusionId,
}) => (
    <div>
        <p className="number">
            id: {id}
        </p>
    </div>
);

export default Agenda;
